function ActionCashierWithdraw() {
	if (eventsLocked) return console.log('BLOCKING EVENTS'),
		!0;
	console.log('LOCKING EVENTS'),
	eventsLocked = !0,
	$('#cashier-withdraw-button').siblings('.chocolate-loader').show();
	var a = $('#cashier-withdraw-amount-textbox').val(),
	b = $('#cashier-withdraw-address-textbox').val(),
	c = $('#cashier-withdraw-password-textbox').val(),
	d = $('#cashier-withdraw-otp-textbox').val();
	return $.ajax({
		type: 'POST',
		url: '/php/cashier/bitcoin_request_withdraw.php',
		dataType: 'json',
		data: {
			bitcoin_address: b,
			bitcoin_amount: a,
			password: c,
			otp: d
		},
		success: BitcoinWithdrawRequestCallback,
		error: showError
	})
}
function ActionCashierTransfer() {
	var a = $('#cashier-transfer-amount-textbox').val().replace(/</g, '&lt').replace(/>/g, '&gt'),
	b = $('#cashier-transfer-userid-textbox').val().replace(/</g, '&lt').replace(/>/g, '&gt'),
	c = $('#cashier-transfer-password-textbox').val().replace(/</g, '&lt').replace(/>/g, '&gt'),
	d = $('#cashier-transfer-otp-textbox').val();
	if (!isFinite(b) || '' == b) throw new Error('User # is not valid');
	if (eventsLocked) throw console.log('BLOCKING EVENTS'),
		new Error('Events are currently blocked.');
	return console.log('LOCKING EVENTS'),
	eventsLocked = !0,
	$('#cashier-transfer-button').siblings('.chocolate-loader').show(),
	$.ajax({
		type: 'POST',
		url: '/php/cashier/bitcoin_request_transfer_queue.php',
		dataType: 'json',
		data: {
			user_id_to: b,
			bitcoin_amount: a,
			password: c,
			otp: d
		},
		success: BitcoinTransferRequestCallback,
		error: showError
	})
}
